    "    ax.set_title(f\"Actual vs Predicted for {waste_type}\")\n",
    "    ax.set_xlabel(\"Time\")\n",
    "    ax.set_ylabel(\"Waste Amount\")\n",
    "\n",
    "# Menampilkan plot\n",
